import React from 'react';
import './data.css';
import {Box, TextField, Button} from '@mui/material';


export default function Data() {

  return (
    <>
    <div className="data">
      <div className = "mdata"> 
          <h1>My Fitness Tracker</h1>
          <div> 
            <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
          <TextField required id="outlined-basic" label="Exercise" variant="outlined" />
          <TextField required id="outlined-basic" label="No Of Sets" variant="outlined" />
          </Box>
          </div>

          <div>
            <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
            <TextField required id="outlined-basic" label="Reps" variant="outlined" />
            <TextField required id="outlined-basic" label="Unit" variant="outlined" />
            </Box>
            </div>

            <div>
            <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
        
      }}
      noValidate
      autoComplete="off"
    >
              <TextField required id="outlined-basic"  label="Date" variant="outlined" />
              </Box>
              </div>
              <div><Button variant="contained">Submit</Button></div>
              
      </div>
          
        </div>
        
    </>
  )
}
